import { useEffect, useState } from "react";
import { getAll } from "../../../services/showsService";

export const NewestMovies = () =>  {
    const [moviesList, setMoviesList ] = useState([]);

    useEffect(() => {
        setMoviesList(getAll('Movie'));
    }, [])

    return (
        <>
       {moviesList.lenght > 0 && moviesList.map(x => <p>{x.id}</p>)}
       </>
    );
};
